class CommandBaseComponent {
    constructor(monitoringService, cryptoTool) {
        this.monitoringService = monitoringService;
        this.cryptoTool = cryptoTool;
        this.dataMonitoring = [];
        this.dataMonitoringEvents = [];
        this.dataMonitoringDevices = [];
        this.view = [300, 300];
        // options Pie Chart
        this.gradientMonitoringDevices = true;
        this.showLegendMonitoringDevices = true;
        this.showLabelsMonitoringDevices = true;
        this.isDoughnutMonitoringDevices = false;
        this.legendPositionMonitoringDevices = 'below';
        this.legendTitleMonitoringDevices = 'Devices';
        // options Bar Chart
        this.showXAxisMonitoringEvents = true;
        this.showYAxisMonitoringEvents = true;
        this.gradientMonitoringEvents = false;
        this.showLegendMonitoringEvents = true;
        this.legendPositionMonitoringEvents = 'below';
        this.legendTitleMonitoringEvents = 'Events';
        this.showXAxisLabelMonitoringEvents = true;
        this.xAxisLabelMonitoringEvents = 'Device';
        this.showYAxisLabelMonitoringEvents = true;
        this.yAxisLabelMonitoringEvents = 'Events';
        this.colorScheme = {
            domain: ['#5AA454', '#A10A28', '#C7B42C', '#AAAAAA']
        };
        this.dataGeolocalization = [];
        this.viewGeolocalization = [500, 300];
        // options
        this.showXAxisGeolocalization = true;
        this.showYAxisGeolocalization = true;
        this.gradientGeolocalization = true;
        this.showLegendGeolocalization = true;
        this.showXAxisLabelGeolocalization = true;
        this.xAxisLabelGeolocalization = 'Routes';
        this.showYAxisLabelGeolocalization = true;
        this.yAxisLabelGeolocalization = 'Vehicles';
        this.legendPositionGeolocalization = 'below';
        this.legendTitleGeolocalization = 'Fleets';
        this.colorSchemeGeolocalization = {
            domain: ['#5AA454', '#C7B42C', '#AAAAAA']
        };
        this.tempList = [];
        this.tempGeolocalizationList = [];
    }
    ngOnInit() {
    }
    ngAfterViewInit() {
        this.loadMonitoring();
    }
    loadMonitoring() {
        const account = localStorage.getItem('vp');
        this.monitoringService.getEventsByAccount(this.cryptoTool.decryptString(account))
            .subscribe(data => {
            const newData = {
                name: "Active",
                value: 4
            };
            const newData2 = {
                name: "Inactive",
                value: 1
            };
            this.tempList.push(newData);
            this.tempList.push(newData2);
            this.dataMonitoringDevices = this.tempList;
            this.tempList = [];
            const newData3 = {
                name: "GPIO",
                value: 20
            };
            const newData4 = {
                name: "GPIO2",
                value: 15
            };
            this.tempList.push(newData3);
            this.tempList.push(newData4);
            this.dataMonitoringEvents = this.tempList;
            console.log("Load Monitoring success! ");
            this.loadGeolocalization();
        });
    }
    loadGeolocalization() {
        this.tempGeolocalizationList = [];
        const newData5 = {
            name: "Flotilla 1",
            series: [
                {
                    name: "Route",
                    value: 1
                }
            ]
        };
        this.tempGeolocalizationList.push(newData5);
        this.dataGeolocalization = this.tempGeolocalizationList;
        console.log("Load Geolocalization success! ");
    }
    onSelect(data) {
        console.log('Item clicked', JSON.parse(JSON.stringify(data)));
    }
    onActivate(data) {
        console.log('Activate', JSON.parse(JSON.stringify(data)));
    }
    onDeactivate(data) {
        console.log('Deactivate', JSON.parse(JSON.stringify(data)));
    }
}


